grA(){return"Deto is developed and conceived for you, the app should be a useful tool for you and offer you a platform for the central collection and publication of your politically motivated events, so each of us now has the opportunity to plan and publish our own events, and thus your events as centrally and easily accessible as possible to be presented to a large audience for viewing.\n\nDeto primarily focuses on politically, democratically motivated events,however, the app also offers you the opportunity to create and publish non-political events.\n\nYou can share your events or deposit your social / live stream platforms,or get notified about upcoming events and much more...\n\nWe hope that we were able to contribute a small part to democratic development with our app, and we are very happy if you use our app and recommend it if you like it.\n\nIf you have any questions, requests or suggestions for improvement, you can either use the contact form in the About Screen or simply enter our Telegram group t.me./deto-app_group or visit the channel t.me/deto_app_channel/. and subscribe.\n\nWe wish you every success in creating and hosting your events, we hope you have a lot of fun with your Deto app.\n\nNote: Please select you preferred language and theme option, to continue you must confirm the checkbox at the bottom\n\nYour deto team"},
