gpt(){return"Deto is een gratis afspraakkalender -app voor allerlei democratische gebeurtenissen.\n\nDeto is voor u bedacht en ontwikkeld en zou een nuttig hulpmiddel voor u moeten zijn om uw politieke en democratische wensen te kunnen uiten. We hopen dat we hier een klein deel aan kunnen bijdragen met onze app.\n\nHet besef en de realisatie van de Deto -app is een gemeenschapsinspanning en het zou nooit zijn voltooid zonder de hulp van een speciaal persoon. Daarom gaat onze speciale dank aan Roi Peker, die de hele technische backend ontwikkelde tijdens de hele ontwikkeling en deze zeer competent heeft ge\xefmplementeerd, en ons altijd een zeer helpende hand geeft op vele andere punten. We zouden daarom heel blij zijn als je deze persoon zou steunen, dus kijk eens naar het dialoogvenster Ontwikkelaar, dat je een beetje verder kunt vinden. Klik eenmaal op het veld om het te vergroten en vervolgens op de knop binnenin.\n\nVeel dank aan alle kleinere deto -helpers, zowel in de nabije toekomst als in het verleden.\n\n-\n\n-\n\n-\n\nSpeciale groeten aan:\n\n- Roi Peker (Tech Mage)\n\nWe staan \u200b\u200baltijd open voor suggesties voor verbetering, als u vragen of iets anders hebt, kunt u het contactformulier gebruiken of gewoon lid worden van onze telegramgroep of het Deto Telegram -kanaal bezoeken.\n\nWe wensen u elk succes met uw evenementen en we hopen dat u veel plezier hebt met uw Deto -app.\n\nNogmaals bedankt aan Roi Peker, blijf zoals je bent, een geweldig persoon ..."},
